  const numberOfKeepsPerOperator = operators.reduce(function (acc, curr) {
    if (typeof acc[curr] == "undefined") {
      acc[curr] = 1
    } else {
      acc[curr] += 1
    }

    return acc
  }, {})

  console.log(JSON.stringify(numberOfKeepsPerOperator))

  console.log('calculating unbonded value...')

  try {
  const sortitionPool = await BondedSortitionPool.at(
    "0x20F1f14a42135d3944fEd1AeD2bE13b01c152054"
  )
  const bonding = await KeepBonding.at(
    "0x60535A59B4e71F908f3fEB0116F450703FB35eD8"
  )
  console.log('getting events...')
  const events = await bonding.getPastEvents("UnbondedValueDeposited", {
    fromBlock: 0,
    toBlock: "latest",
  })

  const unique = new Set()
  operators.forEach((member) => unique.add(member))
  console.log('got unique operators')
  for (const op of unique) {
    const weight = await sortitionPool.getPoolWeight(op)

    const opEvents = events.filter((e) => {
      return e.returnValues.operator == op
    })

    let deposited = web3.utils.toBN(0)
    for (const e of opEvents) {
      deposited = deposited.add(web3.utils.toBN(e.returnValues.amount))
    }

    console.log(
      `${op} ${numberOfKeepsPerOperator[op]} ${weight} ${web3.utils.fromWei(
        deposited
      )}`
    )
  }
} catch (error) {
  console.log(error)
}

  process.exit()
